import './ReviewBox.css';


export default function ReviewBox() {

  return (
    <Card className="box-container" style={{ borderRadius: '10px', overflow: 'hidden' }}> 
      <CardContent>
        <di className="desc">
        </di>
      </CardContent>
    </Card>
  );
}
